export const quotesData = [
    { quote: "You are the sunshine in my life." },
    { quote: "My love for you is endless." },
    { quote: "You complete me." },
    { quote: "You make my heart skip a beat." },
    { quote: "Forever yours." },
    { quote: "世界的温柔，是晚来的善意和干净的你。" },

    { quote: "有了你，我的世界变得更加美好。" }
  ];
